description:
Stargaze HD: Universal Beauty

Nature Documentary with no narration published by HDScape in 2008 - No spoken language


Information
------------------------------

StarGaze HD brings the beauty and majesty of the Universe to your HD Home Theatre. Journey beyond the stars with panning images from the Hubble Space Telescope, Spitzer Space Telescope, and the Chandra X-Ray Observatory. With over an hour of astounding images set to ambient music.

